import React from 'react';

import '../stylesheets/VerifyEmailPage.css';

const VerifyEmailPage = () => {

    const message = "En e-mail med en lenke har blitt sendt til *e-mail*. " +
        "\n" +
        "Vennligst åpne e-mailen og trykk på lenken for å verifisere din e-mailadresse." +

        "Trykk på knappen nedenfor for å logge inn når du har verifisert e-mailadressen din."

    return (
        <div className="formBox">
            <div className="messageBox">
                <h5>
                    {message}
                </h5>
            </div>

            <button></button>

        </div>
    )

}

export default VerifyEmailPage;
